tables.table_schema:
CREATE TABLE user_behavior ( 
    user_id UUID PRIMARY KEY, 
    timestamp TIMESTAMP, 
    event_type VARCHAR, 
    event_data JSONB 
);

CREATE TABLE web_traffic_data (
    user_id INT,
    page_url VARCHAR,
    timestamp TIMESTAMP,
    traffic_type VARCHAR
);

CREATE TABLE user_activity (
    user_id INT,
    activity_type VARCHAR,
    activity_timestamp TIMESTAMP
);

CREATE TABLE user_profile (
    user_id INT,
    username VARCHAR,
    email VARCHAR,
    join_date DATE
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    joined_at TIMESTAMP
);

CREATE TABLE pages (
    page_id INT PRIMARY KEY,
    url VARCHAR(255),
    category VARCHAR(50),
    created_at TIMESTAMP
);

CREATE TABLE sessions (
    session_id INT PRIMARY KEY,
    user_id INT,
    start_time TIMESTAMP,
    end_time TIMESTAMP
);
